import React from 'react';
import './App.css';

function Box(props){
  return (
    <table className="table table-striped">
      <tr>
      <th>No</th>
      <th>Name</th>
      <th>Person</th>
      <th>Amount</th>
      <th>Other</th>
      </tr>
      <tr> 
        <td>{props.num}</td>
        <td>{props.name}</td>
        <td>{props.person}</td>
        <td>{props.amount}</td>
        <td>{props.other}</td>
      </tr>
    </table>
  );
}

function App() {
  return (
    <div className="App">
    <h1>Hello</h1>
    <Box num="2" name="mike" person="lola's human"/>
    </div>
  );
}

export default App;
